import React from 'react';
import './App.css';
import { Route } from 'react-router-dom';
import HomePage from './pages/homepage/hoempage.component';
const hatsPage = () => (
  <div>
    <h1>HATS APGE</h1>
  </div>
);

function App() {
  return (
    <div>
   <Route>
      <Route exact path='/' element={<HomePage />} />
      <Route path='/hats' element={<HatsPage />} />
   </Route>
 </div>
  );
}

export default App;
